import React from "react";

export default class PackageFilter extends React.Component {
  render() {
    console.log(this.props,"These are my props ")
    return (
      
      <section className="filterBar">
        <h2>Track your Package here</h2>
        <input
          type="text"
          placeholder="Search with your Package Id..."
          value={this.props.value}
          //readOnly
         onChange={this.props.onChange}
        />
         <button type="submit" id="searchSubmit" value={this.props.value} onClick={this.props.onClick}/>
      </section>
    );
  }
}
